import React from "react";
import { Route, Switch } from "react-router-dom";
import Components from "./Home/Components.js";

import Header from "components/Header/Header.js";



import { makeStyles } from "@material-ui/core/styles";

import styles from "assets/jss/material-kit-react/views/components.js";

import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";

import Button from "components/CustomButtons/Button.js";
import Parallax from "components/Parallax/Parallax.js";
// sections for this page
import HeaderLinks from "components/Header/HeaderLinks.js";
import Card from "components/Card/Card.js";
import CardBody from "components/Card/CardBody.js";
import CustomInput from "components/CustomInput/CustomInput.js";
import { Grid, InputLabel } from "@material-ui/core";
import { FormControl } from "@material-ui/core";
import { MenuItem } from "@material-ui/core";
import { Select } from "@material-ui/core";

    const useStyles = makeStyles(styles);
    const classes = useStyles();
    const index = (props) => {

  const { ...rest } = props;

  return (
    <>
      <Header
        brand="eRent"
        rightLinks={<HeaderLinks />}
        fixed
        color="transparent"
        changeColorOnScroll={{
          height: 400,
          color: "white",
        }}
        {...rest}
      />
      <Parallax image={require("assets/img/image_3.png")}>
        <div className={classes.container}>
          <Card style={{ width: "67rem" }}>
            <CardBody>
              <h4 className={classes.cardTitle}>
                CHERCHER VOTRE APPART DE REVE
              </h4>
              <Grid>
                <GridContainer>
                  <Grid item xs={12} sm={12} md={5}>
                    <CustomInput
                      id="input_search"
                      inputProps={{
                        placeholder: "Universit√©, logement ...",
                      }}
                      formControlProps={{
                        fullWidth: true,
                      }}
                    />
                  </Grid>
                  <Grid>
                    <Grid itemxs={12} sm={12} md={4}>
                      <FormControl className={classes.formControl}>
                        <InputLabel id="demo-simple-select-autowidth-label">
                          Ville
                        </InputLabel>
                        <Select
                          labelId="demo-simple-select-label"
                          id="demo-simple-select"
                        >
                          <MenuItem value="Sal√©">Sal√©</MenuItem>
                          <MenuItem value="Rabat">Rabat</MenuItem>
                          <MenuItem value="Casablance"> Casablanca</MenuItem>
                        </Select>
                      </FormControl>
                    </Grid>
                  </Grid>

                  <Grid>
                    <Grid item xs={12} sm={12} md={3}>
                      <FormControl className={classes.formControl}>
                        <InputLabel id="demo-simple-select-autowidth-label">
                          Mode
                        </InputLabel>
                        <Select
                          labelId="demo-simple-select-label"
                          id="demo-simple-select"
                        >
                          <MenuItem value="Location">Location</MenuItem>
                          <MenuItem value="Colocation">Colocation</MenuItem>
                        </Select>
                      </FormControl>
                    </Grid>
                  </Grid>
                  <Grid>
                    <Grid item xs={12} sm={12} md={3}>
                      <FormControl className={classes.formControl}>
                        <InputLabel id="demo-simple-select-autowidth-label">
                          Categorie
                        </InputLabel>
                        <Select
                          labelId="demo-simple-select-label"
                          id="demo-simple-select"
                        >
                          <MenuItem value="Appartement">Appartement</MenuItem>
                          <MenuItem value="Studio">Studio</MenuItem>
                          <MenuItem value="Residence √©tudiants">
                            Residence √©tudiants
                          </MenuItem>
                          <MenuItem value="Cit√© universitaire">
                            Cit√© universitaire
                          </MenuItem>
                        </Select>
                      </FormControl>
                    </Grid>
                  </Grid>
                  <GridItem>
                    <span className="slide-title">Prix max (dh)</span>
                    <div id="sliderDouble1" className="slider-info" />

                    <span className="slide-title">Superficie max (m¬≤)</span>
                    <div id="sliderDouble2" className="slider-info" />
                  </GridItem>
                </GridContainer>
              </Grid>
              <Button color="warning">Rechercher</Button>
            </CardBody>
          </Card>
        </div>
      </Parallax>

      <Switch>
        <Route path="/Search" exact render={(props) => <div>hello</div>} />
        <Route path="/" exact render={(props) => <Components {...props} />} />
      </Switch>
    </>
  );
};

export default index;
